"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[23573],{23573:e=>{e.exports=JSON.parse('{"ai21":{"description":"AI21 Labs buduje podstawowe modele i systemy sztucznej inteligencji dla przedsiębiorstw, przyspieszając zastosowanie generatywnej sztucznej inteligencji w produkcji."},"ai302":{"description":"302.AI to platforma aplikacji AI na żądanie, oferująca najszerszy wyb\xf3r API AI i aplikacji AI online na rynku"},"ai360":{"description":"360 AI to platforma modeli i usług AI wprowadzona przez firmę 360, oferująca r\xf3żnorodne zaawansowane modele przetwarzania języka naturalnego, w tym 360GPT2 Pro, 360GPT Pro, 360GPT Turbo i 360GPT Turbo Responsibility 8K. Modele te łączą dużą liczbę parametr\xf3w z multimodalnymi zdolnościami, szeroko stosowanymi w generowaniu tekstu, rozumieniu semantycznym, systemach dialogowych i generowaniu kodu. Dzięki elastycznej strategii cenowej, 360 AI zaspokaja zr\xf3żnicowane potrzeby użytkownik\xf3w, wspierając integrację przez deweloper\xf3w, co przyczynia się do innowacji i rozwoju aplikacji inteligentnych."},"aihubmix":{"description":"AiHubMix zapewnia dostęp do r\xf3żnych modeli AI za pośrednictwem zunifikowanego interfejsu API."},"akashchat":{"description":"Akash to rynek zasob\xf3w chmurowych bez konieczności uzyskiwania zezwoleń, oferujący konkurencyjne ceny w por\xf3wnaniu z tradycyjnymi dostawcami chmury."},"anthropic":{"description":"Anthropic to firma skoncentrowana na badaniach i rozwoju sztucznej inteligencji, oferująca szereg zaawansowanych modeli językowych, takich jak Claude 3.5 Sonnet, Claude 3 Sonnet, Claude 3 Opus i Claude 3 Haiku. Modele te osiągają idealną r\xf3wnowagę między inteligencją, szybkością a kosztami, nadając się do r\xf3żnych zastosowań, od obciążeń na poziomie przedsiębiorstw po szybkie odpowiedzi. Claude 3.5 Sonnet, jako najnowszy model, wyr\xf3żnia się w wielu ocenach, jednocześnie zachowując wysoką opłacalność."},"azure":{"description":"Azure oferuje r\xf3żnorodne zaawansowane modele AI, w tym GPT-3.5 i najnowszą serię GPT-4, wspierające r\xf3żne typy danych i złożone zadania, koncentrując się na bezpiecznych, niezawodnych i zr\xf3wnoważonych rozwiązaniach AI."},"azureai":{"description":"Azure oferuje wiele zaawansowanych modeli AI, w tym GPT-3.5 i najnowszą serię GPT-4, wspierając r\xf3żne typy danych i złożone zadania, dążąc do bezpiecznych, niezawodnych i zr\xf3wnoważonych rozwiązań AI."},"baichuan":{"description":"Baichuan Intelligent to firma skoncentrowana na badaniach nad dużymi modelami sztucznej inteligencji, kt\xf3rej modele osiągają doskonałe wyniki w krajowych zadaniach związanych z encyklopedią wiedzy, przetwarzaniem długich tekst\xf3w i generowaniem treści w języku chińskim, przewyższając zagraniczne modele mainstreamowe. Baichuan Intelligent dysponuje r\xf3wnież wiodącymi w branży zdolnościami multimodalnymi, osiągając doskonałe wyniki w wielu autorytatywnych ocenach. Jej modele obejmują Baichuan 4, Baichuan 3 Turbo i Baichuan 3 Turbo 128k, zoptymalizowane pod kątem r\xf3żnych scenariuszy zastosowań, oferując opłacalne rozwiązania."},"bedrock":{"description":"Bedrock to usługa oferowana przez Amazon AWS, skoncentrowana na dostarczaniu zaawansowanych modeli językowych i wizualnych dla przedsiębiorstw. Jej rodzina modeli obejmuje serię Claude od Anthropic, serię Llama 3.1 od Meta i inne, oferując r\xf3żnorodne opcje od lekkich do wysokowydajnych, wspierając generowanie tekstu, dialogi, przetwarzanie obraz\xf3w i inne zadania, odpowiednie dla r\xf3żnych skal i potrzeb aplikacji biznesowych."},"bfl":{"description":"Wiodące, pionierskie laboratorium badań nad sztuczną inteligencją, tworzące wizualną infrastrukturę jutra."},"cerebras":{"description":"Cerebras to platforma do wnioskowania AI oparta na dedykowanym systemie CS-3, zaprojektowana w celu zapewnienia najszybszej na świecie, reakcji w czasie rzeczywistym oraz wysokiej przepustowości usług LLM. Stworzona została, aby eliminować op\xf3źnienia i przyspieszać złożone przepływy pracy AI, takie jak generowanie kodu w czasie rzeczywistym i zadania agentowe."},"cloudflare":{"description":"Uruchamiaj modele uczenia maszynowego napędzane przez GPU w globalnej sieci Cloudflare."},"cohere":{"description":"Cohere przynosi najnowocześniejsze modele wielojęzyczne, zaawansowane funkcje wyszukiwania oraz dostosowane do nowoczesnych przedsiębiorstw przestrzenie robocze AI — wszystko zintegrowane w jednej bezpiecznej platformie."},"cometapi":{"description":"CometAPI to platforma usługowa oferująca r\xf3żnorodne interfejsy najnowocześniejszych modeli, wspierająca OpenAI, Anthropic, Google i inne. Idealna do zr\xf3żnicowanych potrzeb deweloperskich i aplikacyjnych. Użytkownicy mogą elastycznie wybierać najlepsze modele i ceny, co wspiera poprawę doświadczeń związanych ze sztuczną inteligencją."},"comfyui":{"description":"Potężny, otwartoźr\xf3dłowy silnik przepływu pracy do generowania obraz\xf3w, wideo i dźwięku, obsługujący zaawansowane modele takie jak SD FLUX, Qwen, Hunyuan, WAN, oferujący edytor przepływu pracy oparty na węzłach oraz możliwość wdrożenia lokalnego."},"deepseek":{"description":"DeepSeek to firma skoncentrowana na badaniach i zastosowaniach technologii sztucznej inteligencji, kt\xf3rej najnowszy model DeepSeek-V2.5 łączy zdolności do prowadzenia og\xf3lnych rozm\xf3w i przetwarzania kodu, osiągając znaczące postępy w zakresie dostosowywania do preferencji ludzkich, zadań pisarskich i przestrzegania instrukcji."},"fal":{"description":"Platforma generatywna medi\xf3w skierowana do deweloper\xf3w"},"fireworksai":{"description":"Fireworks AI to wiodący dostawca zaawansowanych modeli językowych, skoncentrowany na wywołaniach funkcji i przetwarzaniu multimodalnym. Jego najnowszy model Firefunction V2 oparty na Llama-3, zoptymalizowany do wywołań funkcji, dialog\xf3w i przestrzegania instrukcji. Model wizualny FireLLaVA-13B wspiera mieszane wejścia obraz\xf3w i tekstu. Inne znaczące modele to seria Llama i seria Mixtral, oferujące efektywne wsparcie dla wielojęzycznego przestrzegania instrukcji i generacji."},"giteeai":{"description":"Serverless API Gitee AI zapewnia deweloperom sztucznej inteligencji gotową usługę interfejsu interfejsu interfejsu dużych modeli."},"github":{"description":"Dzięki modelom GitHub, deweloperzy mogą stać się inżynierami AI i budować z wykorzystaniem wiodących modeli AI w branży."},"google":{"description":"Seria Gemini od Google to najnowocześniejsze, uniwersalne modele AI stworzone przez Google DeepMind, zaprojektowane z myślą o multimodalności, wspierające bezproblemowe rozumienie i przetwarzanie tekstu, kodu, obraz\xf3w, dźwięku i wideo. Nadają się do r\xf3żnych środowisk, od centr\xf3w danych po urządzenia mobilne, znacznie zwiększając wydajność i wszechstronność modeli AI."},"groq":{"description":"Silnik inferencyjny LPU firmy Groq wyr\xf3żnia się w najnowszych niezależnych testach benchmarkowych dużych modeli językowych (LLM), redefiniując standardy rozwiązań AI dzięki niesamowitej szybkości i wydajności. Groq jest reprezentantem natychmiastowej szybkości inferencji, wykazując dobrą wydajność w wdrożeniach opartych na chmurze."},"higress":{"description":"Higress to chmurowa brama API, kt\xf3ra powstała w firmie Alibaba, aby rozwiązać problemy związane z ponownym ładowaniem Tengine, kt\xf3re negatywnie wpływa na długoterminowe połączenia, oraz niewystarczającą zdolnością do r\xf3wnoważenia obciążenia gRPC/Dubbo."},"huggingface":{"description":"HuggingFace Inference API oferuje szybki i bezpłatny spos\xf3b na eksplorację tysięcy modeli, kt\xf3re nadają się do r\xf3żnych zadań. Niezależnie od tego, czy prototypujesz nową aplikację, czy pr\xf3bujesz funkcji uczenia maszynowego, to API zapewnia natychmiastowy dostęp do wysokowydajnych modeli z wielu dziedzin."},"hunyuan":{"description":"Model językowy opracowany przez Tencent, kt\xf3ry posiada potężne zdolności tw\xf3rcze w języku chińskim, umiejętność logicznego wnioskowania w złożonych kontekstach oraz niezawodne zdolności wykonawcze w zadaniach."},"infiniai":{"description":"Dostarczanie usług wysokiej wydajności, łatwych w użyciu i bezpiecznych modeli dużych, obejmujących cały proces od opracowywania modeli do wdrożenia usług opartych na modelach dużych."},"internlm":{"description":"Organizacja open source poświęcona badaniom i rozwojowi narzędzi dla dużych modeli. Oferuje wszystkim deweloperom AI wydajną i łatwą w użyciu platformę open source, umożliwiającą dostęp do najnowocześniejszych technologii modeli i algorytm\xf3w."},"jina":{"description":"Jina AI została założona w 2020 roku i jest wiodącą firmą zajmującą się AI w zakresie wyszukiwania. Nasza platforma bazowa do wyszukiwania zawiera modele wektorowe, przetasowujące i małe modele językowe, kt\xf3re pomagają firmom budować niezawodne i wysokiej jakości aplikacje wyszukiwania generatywnego i multimodalnego."},"lmstudio":{"description":"LM Studio to aplikacja desktopowa do rozwijania i eksperymentowania z LLM-ami na Twoim komputerze."},"minimax":{"description":"MiniMax to firma technologiczna zajmująca się og\xf3lną sztuczną inteligencją, założona w 2021 roku, dążąca do wsp\xf3łtworzenia inteligencji z użytkownikami. MiniMax opracowało r\xf3żne modele dużych modeli o r\xf3żnych modalnościach, w tym model tekstowy MoE z bilionem parametr\xf3w, model głosowy oraz model obrazowy. Wprowadziło r\xf3wnież aplikacje takie jak Conch AI."},"mistral":{"description":"Mistral oferuje zaawansowane modele og\xf3lne, specjalistyczne i badawcze, szeroko stosowane w złożonym rozumowaniu, zadaniach wielojęzycznych, generowaniu kodu i innych dziedzinach. Dzięki interfejsowi wywołań funkcji użytkownicy mogą integrować dostosowane funkcje, realizując konkretne zastosowania."},"modelscope":{"description":"ModelScope to platforma modelu jako usługi wprowadzona przez Alibaba Cloud, oferująca bogaty wyb\xf3r modeli AI i usług inferencyjnych."},"moonshot":{"description":"Moonshot to otwarta platforma stworzona przez Beijing Dark Side Technology Co., Ltd., oferująca r\xf3żnorodne modele przetwarzania języka naturalnego, szeroko stosowane w takich dziedzinach jak tworzenie treści, badania akademickie, inteligentne rekomendacje, diagnoza medyczna i inne, wspierająca przetwarzanie długich tekst\xf3w i złożone zadania generacyjne."},"nebius":{"description":"Nebius zapewnia wysokowydajną infrastrukturę dla globalnych innowator\xf3w AI poprzez budowę dużych klastr\xf3w GPU i pionową integrację platformy chmurowej."},"newapi":{"description":"Otwarta platforma agregująca i jednolicie przekazująca wiele usług AI"},"novita":{"description":"Novita AI to platforma oferująca API do r\xf3żnych dużych modeli językowych i generacji obraz\xf3w AI, elastyczna, niezawodna i opłacalna. Wspiera najnowsze modele open-source, takie jak Llama3, Mistral, i oferuje kompleksowe, przyjazne dla użytkownika oraz automatycznie skalowalne rozwiązania API dla rozwoju aplikacji generatywnej AI, odpowiednie dla szybkiego rozwoju startup\xf3w AI."},"nvidia":{"description":"NVIDIA NIM™ oferuje kontenery do samodzielnego hostowania przyspieszonych przez GPU mikroserwis\xf3w wnioskowania, wspierając wdrażanie w chmurze, centrach danych, komputerach osobistych RTX™ AI i stacjach roboczych wstępnie wytrenowanych i dostosowanych modeli AI."},"ollama":{"description":"Modele oferowane przez Ollama obejmują szeroki zakres zastosowań, w tym generowanie kodu, obliczenia matematyczne, przetwarzanie wielojęzyczne i interakcje konwersacyjne, wspierając r\xf3żnorodne potrzeby wdrożeń na poziomie przedsiębiorstw i lokalnych."},"ollamacloud":{"description":"Ollama Cloud oferuje oficjalnie hostowaną usługę inferencji, umożliwiającą natychmiastowy dostęp do biblioteki modeli Ollama oraz obsługę interfejsu zgodnego z OpenAI."},"openai":{"description":"OpenAI jest wiodącą na świecie instytucją badawczą w dziedzinie sztucznej inteligencji, kt\xf3rej modele, takie jak seria GPT, przesuwają granice przetwarzania języka naturalnego. OpenAI dąży do zmiany wielu branż poprzez innowacyjne i efektywne rozwiązania AI. Ich produkty charakteryzują się znaczną wydajnością i opłacalnością, znajdując szerokie zastosowanie w badaniach, biznesie i innowacyjnych aplikacjach."},"openrouter":{"description":"OpenRouter to platforma usługowa oferująca r\xf3żnorodne interfejsy do nowoczesnych dużych modeli, wspierająca OpenAI, Anthropic, LLaMA i inne, odpowiednia dla zr\xf3żnicowanych potrzeb rozwojowych i aplikacyjnych. Użytkownicy mogą elastycznie wybierać optymalne modele i ceny zgodnie z własnymi potrzebami, co przyczynia się do poprawy doświadczeń związanych z AI."},"perplexity":{"description":"Perplexity to wiodący dostawca modeli generacji dialog\xf3w, oferujący r\xf3żnorodne zaawansowane modele Llama 3.1, wspierające aplikacje online i offline, szczeg\xf3lnie odpowiednie do złożonych zadań przetwarzania języka naturalnego."},"ppio":{"description":"PPIO Paiou Cloud oferuje stabilne i opłacalne usługi API modeli open source, wspierające pełną gamę DeepSeek, Llama, Qwen i inne wiodące modele w branży."},"qiniu":{"description":"Qiniu to wiodący dostawca usług chmurowych, oferujący API do dużych modeli AI, w tym DeepSeek, Llama i Qwen, z elastycznymi opcjami do tworzenia i stosowania aplikacji AI."},"qwen":{"description":"Tongyi Qianwen to samodzielnie opracowany przez Alibaba Cloud model językowy o dużej skali, charakteryzujący się silnymi zdolnościami rozumienia i generowania języka naturalnego. Może odpowiadać na r\xf3żnorodne pytania, tworzyć treści pisemne, wyrażać opinie, pisać kod i działać w wielu dziedzinach."},"sambanova":{"description":"SambaNova Cloud umożliwia deweloperom łatwe korzystanie z najlepszych modeli open source oraz cieszenie się najszybszą prędkością wnioskowania."},"search1api":{"description":"Search1API oferuje dostęp do serii modeli DeepSeek, kt\xf3re można łączyć z siecią w razie potrzeby, w tym wersji standardowej i szybkiej, wspierając wyb\xf3r modeli o r\xf3żnych rozmiarach parametr\xf3w."},"sensenova":{"description":"SenseTime codziennie się rozwija, opierając się na potężnym wsparciu infrastrukturalnym SenseTime, oferując wydajne i łatwe w użyciu usługi dużych modeli w pełnym zakresie."},"siliconcloud":{"description":"SiliconFlow dąży do przyspieszenia AGI, aby przynieść korzyści ludzkości, poprawiając wydajność dużych modeli AI dzięki łatwemu w użyciu i niskokosztowemu stosowi GenAI."},"spark":{"description":"Model Xinghuo od iFlytek oferuje potężne możliwości AI w wielu dziedzinach i językach, wykorzystując zaawansowaną technologię przetwarzania języka naturalnego do budowy innowacyjnych aplikacji odpowiednich dla inteligentnych urządzeń, inteligentnej medycyny, inteligentnych finans\xf3w i innych scenariuszy wertykalnych."},"stepfun":{"description":"Model StepFun charakteryzuje się wiodącymi w branży zdolnościami multimodalnymi i złożonym rozumowaniem, wspierając zrozumienie bardzo długich tekst\xf3w oraz potężne funkcje samodzielnego wyszukiwania."},"taichu":{"description":"Nowa generacja multimodalnych dużych modeli opracowana przez Instytut Automatyki Chińskiej Akademii Nauk i Wuhan Institute of Artificial Intelligence wspiera wielorundowe pytania i odpowiedzi, tworzenie tekst\xf3w, generowanie obraz\xf3w, zrozumienie 3D, analizę sygnał\xf3w i inne kompleksowe zadania pytaniowe, posiadając silniejsze zdolności poznawcze, rozumienia i tworzenia, oferując nową interaktywną doświadczenie."},"tencentcloud":{"description":"Atomowe możliwości silnika wiedzy (LLM Knowledge Engine Atomic Power) oparte na silniku wiedzy, oferujące pełne możliwości zadawania pytań i odpowiedzi, skierowane do przedsiębiorstw i deweloper\xf3w, zapewniające elastyczność w budowaniu i rozwijaniu aplikacji modelowych. Możesz tworzyć własne usługi modelowe za pomocą r\xf3żnych atomowych możliwości, korzystając z usług takich jak analiza dokument\xf3w, podział, embedding, wielokrotne przeredagowywanie i inne, aby dostosować AI do specyficznych potrzeb Twojej firmy."},"togetherai":{"description":"Together AI dąży do osiągnięcia wiodącej wydajności poprzez innowacyjne modele AI, oferując szerokie możliwości dostosowywania, w tym wsparcie dla szybkiej ekspansji i intuicyjnych proces\xf3w wdrożeniowych, aby zaspokoić r\xf3żnorodne potrzeby przedsiębiorstw."},"upstage":{"description":"Upstage koncentruje się na opracowywaniu modeli AI dla r\xf3żnych potrzeb biznesowych, w tym Solar LLM i dokument\xf3w AI, mając na celu osiągnięcie sztucznej og\xf3lnej inteligencji (AGI). Umożliwia tworzenie prostych agent\xf3w konwersacyjnych za pomocą Chat API oraz wspiera wywołania funkcji, tłumaczenia, osadzenia i zastosowania w określonych dziedzinach."},"v0":{"description":"v0 to asystent programowania w parach, kt\xf3ry pozwala opisać pomysły w naturalnym języku, a następnie generuje kod i interfejs użytkownika (UI) dla Twojego projektu"},"vercelaigateway":{"description":"Vercel AI Gateway zapewnia zunifikowane API do dostępu do ponad 100 modeli, umożliwiając korzystanie z modeli wielu dostawc\xf3w, takich jak OpenAI, Anthropic, Google, za pośrednictwem jednego punktu końcowego. Obsługuje ustawienia budżetu, monitorowanie wykorzystania, r\xf3wnoważenie obciążenia żądań oraz przełączanie awaryjne."},"vertexai":{"description":"Seria Gemini od Google to najnowocześniejsze, uniwersalne modele AI stworzone przez Google DeepMind, zaprojektowane z myślą o multimodalności, wspierające bezproblemowe rozumienie i przetwarzanie tekstu, kodu, obraz\xf3w, dźwięku i wideo. Odpowiednie do r\xf3żnych środowisk, od centr\xf3w danych po urządzenia mobilne, znacznie zwiększa efektywność i wszechstronność modeli AI."},"vllm":{"description":"vLLM to szybka i łatwa w użyciu biblioteka do wnioskowania i usług LLM."},"volcengine":{"description":"Platforma deweloperska usług dużych modeli wprowadzona przez ByteDance, oferująca bogate w funkcje, bezpieczne i konkurencyjne cenowo usługi wywoływania modeli. Oferuje r\xf3wnież dane modelowe, dostosowywanie, wnioskowanie, ocenę i inne funkcje end-to-end, zapewniając kompleksowe wsparcie dla rozwoju aplikacji AI."},"wenxin":{"description":"Platforma do rozwoju i usług aplikacji AI oraz dużych modeli w skali przedsiębiorstwa, oferująca najbardziej kompleksowy i łatwy w użyciu zestaw narzędzi do rozwoju modeli sztucznej inteligencji generatywnej oraz całego procesu tworzenia aplikacji."},"xai":{"description":"xAI to firma, kt\xf3ra dąży do budowy sztucznej inteligencji w celu przyspieszenia ludzkich odkryć naukowych. Naszą misją jest wspieranie wsp\xf3lnego zrozumienia wszechświata."},"xinference":{"description":"Xorbits Inference (Xinference) to otwarty platforma, kt\xf3ra ułatwia uruchamianie i integrację r\xf3żnych modeli AI. Dzięki Xinference możesz wykonywać wnioskowanie za pomocą dowolnego otwartego modelu LLM, modelu osadzania i modelu wielomodalnego w środowisku chmurowym lub lokalnym, tworząc przy tym potężne aplikacje AI."},"zeroone":{"description":"01.AI koncentruje się na technologiach sztucznej inteligencji w erze AI 2.0, intensywnie promując innowacje i zastosowania „człowiek + sztuczna inteligencja”, wykorzystując potężne modele i zaawansowane technologie AI w celu zwiększenia wydajności ludzkiej produkcji i realizacji technologicznego wsparcia."},"zhipu":{"description":"Zhipu AI oferuje otwartą platformę modeli multimodalnych i językowych, wspierającą szeroki zakres zastosowań AI, w tym przetwarzanie tekstu, rozumienie obraz\xf3w i pomoc w programowaniu."}}')}}]);